struct Transaction {
    std::string category;
    double amount;
};

struct ExpenseCategory {
    std::string category;
    double totalAmount;
};

bool compareExpenses(const Transaction& a, const Transaction& b) {
    return a.amount > b.amount;
}

bool compareExpenseCategories(const ExpenseCategory& a, const ExpenseCategory& b) {
    return a.totalAmount > b.totalAmount;
}

class PersonalFinanceManager {
private:
    std::vector<double> wallets;
    std::vector<Transaction> transactions;

public:
    void addWallet(double initialAmount) {
        wallets.push_back(initialAmount);
    }

    void deposit(int walletIndex, double amount) {
        wallets[walletIndex] += amount;
    }

    void addExpense(const std::string& category, double amount) {
        Transaction transaction;
        transaction.category = category;
        transaction.amount = amount;
        transactions.push_back(transaction);
    }

    void generateReports() {
        time_t now = time(nullptr);
        tm* currentDate = localtime(&now);

        std::ofstream file;
        std::string filename = "reports_" +
                               std::to_string(currentDate->tm_year + 1900) +
                               std::to_string(currentDate->tm_mon + 1) +
                               std::to_string(currentDate->tm_mday) +
                               ".txt";
        file.open(filename);

        // Generate daily report
        file << "Daily Report (" << currentDate->tm_year + 1900 << "-" << currentDate->tm_mon + 1 << "-" << currentDate->tm_mday << "):\n";
        double totalExpenses = 0.0;
        for (const auto& transaction : transactions) {
            totalExpenses += transaction.amount;
        }
        file << "Total expenses: " << totalExpenses << "\n\n";

        // Generate weekly report
        file << "Weekly Report:\n";
        double totalExpensesWeek = 0.0;
        for (const auto& transaction : transactions) {
            totalExpensesWeek += transaction.amount;
        }
        file << "Total expenses: " << totalExpensesWeek << "\n";

        // Top 3 expenses of the week
        std::sort(transactions.begin(), transactions.end(), compareExpenses);
        file << "Top 3 Expenses:\n";
        for (int i = 0; i < 3 && i < transactions.size(); ++i) {
            file << i + 1 << ". Category: " << transactions[i].category << ", Amount: " << transactions[i].amount << "\n";
        }
        file << "\n";

        // Top 3 expense categories of the week
        std::vector<ExpenseCategory> expenseCategories;
        for (const auto& transaction : transactions) {
            auto it = std::find_if(expenseCategories.begin(), expenseCategories.end(), [&](const ExpenseCategory& ec) {
                return ec.category == transaction.category;
            });
            if (it != expenseCategories.end()) {
                it->totalAmount += transaction.amount;
            } else {
                ExpenseCategory ec;
                ec.category = transaction.category;
                ec.totalAmount = transaction.amount;
                expenseCategories.push_back(ec);
            }
        }
        std::sort(expenseCategories.begin(), expenseCategories.end(), compareExpenseCategories);
        file << "Top 3 Expense Categories:\n";
        for (int i = 0; i < 3 && i < expenseCategories.size(); ++i) {
            file << i + 1 << ". Category: " << expenseCategories[i].category << ", Total Amount: " << expenseCategories[i].totalAmount << "\n";
        }
        file << "\n";

        // Generate monthly report
        file << "Monthly Report (" << currentDate->tm_year + 1900 << "-" << currentDate->tm_mon + 1 << "):\n";
        double totalExpensesMonth = 0.0;
        for (const auto& transaction : transactions) {
            totalExpensesMonth += transaction.amount;
        }
        file << "Total expenses: " << totalExpensesMonth << "\n\n";

        // Top 3 expenses of the month
        file << "Top 3 Expenses of the Month:\n";
        // Implement logic to fetch and write the top 3 expenses of the month

        // Top 3 expense categories of the month
        file << "Top 3 Expense Categories of the Month:\n";
        // Implement logic to fetch and write the top 3 expense categories of the month

        // Close the file
        file.close();
    }
};

